	 (10,'Chuyên khoa Tiêu hoá',decode('','hex'),'<h5><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></h5><ul><li>Ăn uống kém, không ngon</li><li>Rối loạn tiêu hóa, táo bón, trĩ</li><li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li><li>Nội soi dạ dày, đại tràng, tiêu hóa</li><li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li><li>Co thắt thực quản, Hội chứng ruột kích thích</li><li>Đau bụng, dạ dày, đại tràng, thượng vị</li><li>Viêm đại tràng, dạ dày, tá tràng</li><li>Ung thư dạ dày, U nang tuyến tụy</li><li>Bệnh lý về gan, mật</li><li>...</li></ul>','##### **Tư vấn, khám và điều trị các Bệnh Tiêu hóa**\n* Ăn uống kém, không ngon\n* Rối loạn tiêu hóa, táo bón, trĩ\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n* Nội soi dạ dày, đại tràng, tiêu hóa\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n* Co thắt thực quản, Hội chứng ruột kích thích\n* Đau bụng, dạ dày, đại tràng, thượng vị\n* Viêm đại tràng, dạ dày, tá tràng\n* Ung thư dạ dày, U nang tuyến tụy\n* Bệnh lý về gan, mật\n* ...','2023-07-11 14:59:33+07','2023-07-11 14:59:33+07'),
