	 (15,'Chuyên khoa Nam học',decode('','hex'),'<h5><strong>Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học</strong></h5><ul><li>Mãn dục nam giới, Suy sinh dục nam</li><li>Viêm đường tiết niệu – sinh dục</li><li>Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn</li><li>Bệnh lý bao quy đầu: hẹp, dài bao quy đầu</li><li>Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…</li><li>Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…</li><li>Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục</li><li>Xuất tinh ngược, Viêm tinh hoàn</li><li>Các bệnh lý liên quan đến hiếm muộn</li><li>Tinh hoàn ẩn</li><li>...</li></ul>','##### **Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học**\n* Mãn dục nam giới, Suy sinh dục nam\n* Viêm đường tiết niệu – sinh dục\n* Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn\n* Bệnh lý bao quy đầu: hẹp, dài bao quy đầu\n* Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…\n* Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…\n* Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục\n* Xuất tinh ngược, Viêm tinh hoàn\n* Các bệnh lý liên quan đến hiếm muộn\n* Tinh hoàn ẩn\n* ...','2023-07-11 15:03:07+07','2023-07-11 15:03:07+07');
